def levelis(q):
    if q == 0:
        return lev_dict[0]
    if q == 1:
        return lev_dict[1]
    if q == 2:
        return lev_dict[2]
    if q == 3:
        return lev_dict[3]

def new(m, m1):
    lev_dict[4] = (m, m1)

def lvl():
    pygame.init()
    pygame.display.set_caption('q1')
    size = 700, 570
    screen = pygame.display.set_mode(size)


    font = pygame.font.SysFont('', 145)
    screen.fill("purple")
    pygame.draw.rect(screen, (0, 100, 0), pygame.Rect(10, 10, 520, 120), 2)
    pygame.draw.rect(screen, (0, 100, 0), pygame.Rect(170, 160, 520, 120), 2)
    pygame.draw.rect(screen, (0, 100, 0), pygame.Rect(10, 300, 520, 120), 2)
    pygame.draw.rect(screen, (0, 100, 0), pygame.Rect(170, 440, 520, 120), 2)
    screen.blit(font.render(' 1', True, "pink"), (17, 20))
    screen.blit(font.render(' 2', True, "pink"), (184, 170))
    screen.blit(font.render(' 3', True, "pink"), (17, 310))
    screen.blit(font.render(' 4', True, "pink"), (184, 450))

    pygame.display.flip()
    running_for_levels = True
    while running_for_levels:
        for event in pygame.event.get():
            if event.type == pygame.QUIT:
                return 1
            if event.type == pygame.MOUSEBUTTONDOWN:
                if pygame.Rect(10, 10, 520, 120).collidepoint(event.pos):
                    return 2, lev_dict[1][0], lev_dict[1][1]
                if pygame.Rect(170, 160, 520, 120).collidepoint(event.pos):
                    return 2, lev_dict[2][0], lev_dict[2][1]
                if pygame.Rect(10, 300, 520, 120).collidepoint(event.pos):
                    return 2, lev_dict[3][0], lev_dict[3][1]
                if pygame.Rect(170, 440, 520, 120).collidepoint(event.pos):
                    return 2, lev_dict[4][0], lev_dict[4][1]





